import React from "react";
import Card from "./Card";
import { bs } from "./Bs";

const CardList = () => {
  return (
    <div>
      <Card id={bs[0].id} name={bs[0].name} email={bs[0].email} />
      <Card id={bs[1].id} name={bs[1].name} email={bs[1].email} />
      <Card id={bs[2].id} name={bs[2].name} email={bs[2].email} />
    </div>
  );
};

export default CardList;
